INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (1000, 2, 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", "調子が上がって\nきたなっ", 3000, 1, 2);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (5000, 2, 2, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", "ほらほら、\nまだいけるだろ？", 3000, 2, 2);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (10000, 2, 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", "へへっ、おまえら\nやるじゃねえか！", 3000, 3, 3);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (10000, 3, 2, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", "あたしたちはまだ\n止まらねえぜ！", 3000, 4, 3);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (10000, 3, 2, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_1_005_002", "vo_minigame_1013_icon_2_005_002", "見てろよ！\nマコト班の快進撃だ！", 3000, 5, 3);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (10000, 3, 2, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003", "vo_minigame_1013_icon_2_005_003", "うおぉぉっ！\n絶好調だぜ！", 3000, 6, 3);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (0, 4, 2, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_1_006_001", "vo_minigame_1013_icon_2_006_001", "どこまで行けるか\n楽しみだなっ！", 3000, 7, 3);
INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (1, 5, 3, "厄介でしたわ…", "vo_minigame_1013_icon_1_007_001", "vo_minigame_1013_icon_2_007_001", "まだ諦めんなよっ", 1000, 8, 4);
