INSERT INTO `v1_5573b1afb296c7e6840cec546168a1bffe0843749ba0d9251ab1085e0748db14` VALUES (99, 6, 4, "大所帯ですわね", "vo_minigame_1013_icon_1_008_001", "vo_minigame_1013_icon_2_008_001", "マコト班集合！", 1500, 11, 3);
